import React from "react";
import Sidebar from "./Sidebar";
import Main from "./Main";

const Dashboard = ({ id, coins, search, setSearch, open, setOpen }) => {
  return (
    <>
      <div className="flex flex-row">
        <Sidebar />
        <Main
          id={id}
          coins={coins}
          search={search}
          setSearch={setSearch}
          open={open}
          setOpen={setOpen}
        />
      </div>
    </>
  );
};

export default Dashboard;
